  `date_execution` date DEFAULT NULL,
  `date_facture` date NOT NULL,
  `date_paiement` date DEFAULT NULL,
  `created_at` datetime(6) NOT NULL,
  `created_by_id` bigint(20) DEFAULT NULL,
  `updated_at` datetime(6) NOT NULL,
