  KEY `fournisseurs_facture_created_by_id_0c69a008_fk_accounts_` (`created_by_id`),
  KEY `fournisseurs_facture_updated_by_id_6944e6a1_fk_accounts_` (`updated_by_id`),
  CONSTRAINT `fournisseurs_facture_beneficiaire_id_f5995c6c_fk_fournisse` FOREIGN KEY (`beneficiaire_id`) REFERENCES `fournisseurs_beneficiaire` (`id`),
  CONSTRAINT `fournisseurs_facture_contrat_id_5d2a02d0_fk_fournisse` FOREIGN KEY (`contrat_id`) REFERENCES `fournisseurs_contrat` (`id`),
  CONSTRAINT `fournisseurs_facture_created_by_id_0c69a008_fk_accounts_` FOREIGN KEY (`created_by_id`) REFERENCES `accounts_myuser` (`id`),
