  CONSTRAINT `fournisseurs_facture_updated_by_id_6944e6a1_fk_accounts_` FOREIGN KEY (`updated_by_id`) REFERENCES `accounts_myuser` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=528 DEFAULT CHARSET=utf8;
